import { useState } from "react";
import Loading from "../utils/Loading";

class Other extends Loading {

    constructor() {
        super();
        this.state = {...this.state, text: 'LOL'}
        setTimeout( () => { this.setState({ text: 'LOOOOOOL' }); this.hasLoaded() }, 3000)
    }

    renderLoaded () {
        return <p>{this.state.text}</p>
    }

}

export default Other;
